import React from "react";
import "./Navigation.css";

const Navigation = () => {
  return (
    <div className="Nav">
      <div className="buttons">
        <a href="/">
          <img src="/icons/Home-button.png" alt="image" />
        </a>
        <button>
          <img src="/icons/Search-results.png" alt="image" />
        </button>
        <button>
          <img src="/icons/Setting-icon.png" alt="image" />
        </button>
      </div>
    </div>
  );
};

export default Navigation;
